DROP TABLE kurser_bocker;

CREATE TABLE `kurser_bocker` (
  `bok_id` varchar(20) COLLATE utf8_swedish_ci NOT NULL DEFAULT 'x',
  `kurs_id` varchar(25) COLLATE utf8_swedish_ci NOT NULL DEFAULT 'x',
  `ut_tid_id` varchar(20) COLLATE utf8_swedish_ci DEFAULT NULL,
  `NOT_USED_ut_lasar_id` varchar(20) COLLATE utf8_swedish_ci DEFAULT NULL,
  `in_tid_id` varchar(20) COLLATE utf8_swedish_ci DEFAULT NULL,
  `in_lasar_id` varchar(20) COLLATE utf8_swedish_ci DEFAULT NULL,
  `larar_id` varchar(12) COLLATE utf8_swedish_ci DEFAULT NULL,
  `kommentar` text COLLATE utf8_swedish_ci,
  `arkiverad` tinyint(4) DEFAULT '0',
  `demo` tinyint(4) DEFAULT '0',
  `ut_lasar_id` varchar(20) COLLATE utf8_swedish_ci DEFAULT NULL,
  `datum` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`bok_id`,`kurs_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_swedish_ci;




